                                <button type="button" class="btn btn-secondary" disabled>Selesai</button>
                            @elseif ($surat->status == 'Dokumen Lengkap')
                                <button type="submit" class="btn btn-success" id="ubah-status-btn">Ubah Status menjadi Selesai</button>
                            @else
                                <button type="button" class="btn btn-secondary" disabled>Selesai</button>
